import React from 'react';

const NewsletterArchive: React.FC = () => {
  return (
    <div style={{ padding: '40px', textAlign: 'center', color: 'white' }}>
      <h2>Newsletter Archive</h2>
      <p>Week 1: Season Kickoff - Coming Soon!</p>
    </div>
  );
};

export default NewsletterArchive;
